import React from "react";

function Skill() {
  return (
    <div className="">
      <div className="md:flex items-center    md:mx-auto md:w-10/12">
        <div className="mr-4 text-center">
          <span className="text-lg font-bold text-white">Skill Acquired</span>
        </div>
        <div className="flex-1 border-t my-4 hidden md:flex"></div>
      </div>
      <div className="flex items-center   m-auto   md:mx-auto md:w-10/12">
        <div className="flex flex-col text-center bg-teal-900 h-32 w-">
          <img alt="#" src="2afde877-0407-4911-9db8-df1639cb4c4f.png" />
          <p>hello</p>
        </div>
      </div>
    </div>
  );
}

export default Skill;
